import React from 'react';

const Footer = () => {
	return (
		<footer class="page-footer">
  <span>made by </span>
  <a href="https://georgemartsoukos.com/" target="_blank">
    <img width="24" height="24" src="https://assets.codepen.io/162656/george-martsoukos-small-logo.svg" alt="George Martsoukos logo"> </img>
  </a>
</footer>
	)
}

export default Footer;
